{
  "root": true,
  "env": {
    "browser": true,
    "commonjs": true,
    "node": true
  },
  "extends": [
    "eslint:recommended",
    "standard",
    "plugin:import/errors",
    "plugin:import/warnings",
    "plugin:prettier/recommended"
  ],
  "parser": "@babel/eslint-parser",
  "parserOptions": {
    "requireConfigFile": false,
    "ecmaVersion": "latest",
    "sourceType": "module"
  },
  "rules": {
    "react/prop-types": "off",
    "space-before-function-paren": [
      "error",
      {
        "anonymous": "always",
        "named": "never",
        "asyncArrow": "always"
      }
    ],
    "semi": [
      "error",
      "always",
      {
        "omitLastInOneLineBlock": true
      }
    ],
    "react/jsx-uses-react": "off",
    "react/react-in-jsx-scope": "off",
    "comma-dangle": "off",
    "import/order": [
      "error",
      {
        "newlines-between": "always",
        "alphabetize": {
          "order": "asc",
          "caseInsensitive": true
        }
      }
    ],
    "import/named": "error",
    "prettier/prettier": ["error", { "singleQuote": false }],
    "one-var": ["error", "consecutive"],
    "no-use-before-define": "off",
    "no-unmodified-loop-condition": "off",
    "eqeqeq": "warn",
    "prefer-const": "warn",
    "no-proto": "warn"
  },
  "globals": {
    "Inputmask": true,
    "jQuery": false,
    "define": false,
    "require": false
  }
}

const webpackConfig = require("./webpack.config");

module.exports = function (grunt) {
  // Project configuration.
  grunt.initConfig({
    pkg: grunt.file.readJSON("package.json"),
    clean: ["dist"],
    bump: {
      options: {
        files: ["package.json", "bower.json", "composer.json"],
        updateConfigs: ["pkg"],
        commit: false,
        createTag: false,
        push: false,
        prereleaseName: "beta"
      }
    },
    release: {
      options: {
        bump: false,
        commit: false,
        add: false
      }
    },
    nugetpack: {
      dist: {
        src: (function () {
          return "nuspecs/Inputmask.nuspec";
        })(),
        dest: "build/",
        options: {
          version: "<%= pkg.version %>"
        }
      },
      dist2: {
        src: (function () {
          return "nuspecs/jquery.inputmask.nuspec";
        })(),
        dest: "build/",
        options: {
          version: "<%= pkg.version %>"
        }
      }
    },
    nugetpush: {
      dist: {
        src: "build/InputMask.<%= pkg.version %>.nupkg",
        options: {
          source: "https://www.nuget.org"
        }
      },
      dist2: {
        src: "build/jquery.inputMask.<%= pkg.version %>.nupkg",
        options: {
          source: "https://www.nuget.org"
        }
      }
    },
    karma: {
      options: {
        configFile: "karma.conf.js"
      },
      unit: {
        singleRun: true
      }
    },
    eslint: {
      target: "lib/*.js"
    },
    availabletasks: {
      tasks: {
        options: {
          filter: "exclude",
          tasks: ["availabletasks", "default"],
          showTasks: ["user"]
        }
      }
    },
    webpack: {
      main: webpackConfig("production")[0],
      jquery: webpackConfig("production")[1],
      colormask: webpackConfig("production")[2]
    },
    copy: {
      extensions: {
        files: [
          {
            src: "lib/bindings/inputmask.binding.js",
            dest: "dist/bindings/inputmask.binding.js"
          },
          {
            src: "lib/bindings/inputmask.es6.js",
            dest: "dist/inputmask.es6.js"
          },
          { src: "lib/extensions/colormask.css", dest: "dist/colormask.css" },
          {
            src: "Changelog.md",
            dest: "inputmask-pages/src/assets/Changelog.md"
          }
        ]
      }
    }
  });

  // Load the plugin that provides the tasks.
  require("load-grunt-tasks")(grunt);

  grunt.registerTask("publish", ["release", "nugetpack", "nugetpush"]);
  grunt.registerTask("publishnext", function () {
    grunt.config("release.options.npmtag", "next");
    grunt.task.run("release");
  });
  grunt.registerTask("validate", ["webpack", "copy", "eslint", "karma"]);
  grunt.registerTask("build", ["bump:prerelease", "clean", "webpack", "copy"]);
  grunt.registerTask("build:patch", ["bump:patch", "clean", "webpack", "copy"]);
  grunt.registerTask("build:minor", ["bump:minor", "clean", "webpack", "copy"]);
  grunt.registerTask("build:major", ["bump:major", "clean", "webpack", "copy"]);
  grunt.registerTask("default", ["availabletasks"]);
};

import "./bundle";
import Colormask from "./lib/extensions/colormask";
export default Colormask;

import Inputmask from "./bundle";
import "./lib/jquery.inputmask";

export default Inputmask;

import "./lib/polyfills/Object.getPrototypeOf";
